import React, { Component } from 'react'
import axios from 'axios'

class ConsumoApi extends Component{
    
    componentDidMount = () => {
        this.getPokemon()
    }

    getData = () => {
        axios.get("https://orca-api-pokemon.herokuapp.com/api").then(
          (response) => {
            const { data } = response;
            this.setState({
              data
            });
          },
          (error) => {
            console.log("Tengo un error");
          }
        );
      };
    render(){
        return(
            <div>
                Hola
            </div>
        )
    }
}

export default ConsumoApi;
